 margin: 0 auto;
 position: relative;
}

.Grid__Item {
 position: absolute;
}
 
 .pinDescription_attribute_container {
 display: flex;
 flex-direction: column;
 }

 summary::-webkit-details-marker {
 display: none
 }

 .PinDescriptionSeeMore_details {
 margin-top: -15px;
 }

 .PinDescription__desc {
 overflow: hidden;
 text-overflow: ellipsis;
 max-height: 34px;
 display: -webkit-box;
 -webkit-box-orient: vertical;

 color: #333;
 font-size: 13px;
 line-height: 17px;
 margin: 5px 0;
 -moz-osx-font-smoothing: grayscale;
 padding: 0;
 text-align: left;
 -webkit-font-smoothing: antialiased;
 word-wrap: break-word;
 }

 .pinDescriptionPinner__image {
 border-radius: 50%;
 -webkit-box-shadow: 0 0 2px rgba(0,0,0,0.33) inset;
 box-shadow: 0 0 2px rgba(0,0,0,0.33) inset;
 content: ' ';
 height: 24px;
 left: 0;
 position: absolute;
 top: 0;
 width: 24px;
 margin-left: 4px;
 margin-right: 4px;
 }

 .pinDescription_text {
 color: #333;
 font-size: 12px;
 font-weight: normal;
 letter-spacing: -.4px;
 margin: 0;
 overflow: hidden;
 padding: 0 4px;
 text-overflow: ellipsis;
 white-space: nowrap;
 max-width: 180px;
 color: #333;
 letter-spacing: -.4px;
 }

 .pinDescription_pinnerBoardAttribution {
 display: flex;
 align-items: center;
 margin-bottom: 4px;
 }

 .pinDescription_pinnerProfileImage {
 border-radius: 50%;
 position: relative;
 float: left;
 height: 24px;
 width: 24px;
 display: block;
 margin-right: 4px;
 }

 .vaseCarousel_vasetags_container {
 overflow: hidden;
 position: relative;
 }

 .vaseCarousel_vasetags_wrapper {
 overflow: scroll;
 white-space: nowrap;
 padding: 3px 0 22px 0;
 }

 .vaseCarousel_vaseTagLink {
 background-color: #ebebe8;
 border-radius: 5px;
 color: #333;
 display: inline-block;
 font-size: 9px;
 font-weight: bold;
 margin: 0 5px 0 0;
 padding: 7px 7px;
 white-space: nowrap;
 word-wrap: break-word;
 }

 .VaseCarousel__button {
 display: block;
 height: 30px;
 top: 0px;
 position: absolute;
 width: 45px;
 line-height: 25px;
 padding-left: 4px;
 padding-top: 2px;
 }

 .VaseCarousel__buttonLeft {
 left: 0px;
